  [[TuyaSmartSDK sharedInstance] setValue:@(YES) forKey:@"bleMeshEnable"];

Basic Notion

pcc
Each mesh device corresponds to a product, and each product has its own size class label. The SDK uses pcc andtype as the size class label.
Mesh product type
  light(01): 1-5  RGBWC 
  switch(02): 1-6 
